import React from 'react';
import CircularProgress from '@material-ui/core/CircularProgress';

const LoadingLocal = props => {
    const { size, classes } = props;
    return (
        <div className={classes.loadingCenterCard}>
            <CircularProgress  
                size={size}
                color="secondary"
            />                
        </div>
    );
};
export default LoadingLocal;
